<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>

<body>
    <script>
        function aboveScore(students) {
            return students.filter(student => student.score > 75)
                .map(student => student.name)
        }

        const students = [
            { name: 'Alice', score: 85 },
            { name: 'Bob', score: 72 },
            { name: 'Charlie', score: 90 },
            { name: 'David', score: 68 },
            { name: 'Eve', score: 77 }
        ];
        console.log(aboveScore(students))

    </script>
</body>

</html>
